import { Link } from "react-router-dom";

function Header(props) {
  if(props.user) {const user = {isLoggedIn:true, user:props.user};}
  else {const user = {isLoggedIn:false};}

  return (
    <div className="header-wrap" id="header-wrap-main" >
        <Link className="logo" to="/"></Link>
        <Link className="user-icon" id="user-icon-main" to='/user' state={user}></Link>
    </div>
  )
}

export default Header;
